import React from 'react';
import './App.css';
import { Button, Alert, Badge, Navbar, Nav, NavDropdown, Row, Card } from 'react-bootstrap';
import Image1 from './Images/logo.jpg';
import Image2 from './Images/banner1.jpg';
import Jumbotron from './Components/Jumbotron';
import Brands from './Components/Brands';
import End from './Components/End';



function App() {
  return (
    <div className="App">

      <div className="row">
        <div className="col">
          <Nav className="nav navbar-expand-lg bg-light">
            <a href="" className="navbar-brand mx-4 text-reset"><img height="60px" className='mx-' src={Image1} />Nice Commerce</a>
            <ul className="nav m-auto ">
              <li class="nav-item">
                <a class="nav-link text-reset" aria-current="page" href="#">About</a>
              </li>
              <li class="nav-item">
                <a class="nav-link text-reset" aria-current="page" href="#">How it works</a>
              </li>
              <li class="nav-item">
                <a class="nav-link text-reset" aria-current="page" href="#">Why Nice Commerce</a>
              </li>
            </ul>
          </Nav>
        </div>
      </div>

      <Jumbotron />

      <img height="" className='banner my-4' src={Image2} />

      <Brands />

      <End />

    </div>
  );
}

export default App;
